import {rahul} from 'assets/img/image/teams/team19/Rahul Aggarwal.webp';

const teamStyle = {
  '@media (min-width: 800px)': {
    root: {
      flexGrow: 1,
    },
    box: {
      marginLeft: '6vw',
      marginTop: '5vh',  
      boxShadow: '0px 5px 7px 7px #888888',
      height: '32vh',
    },
    bacg: {
      position: 'absolute',
      height: '30vh',
      width: '15vw',
      filter: 'blur(10px)',
      clipPath: 'polygon(0 0, 100% 0%, 100% 43%, 0 64%)'
    },
    imag: {
        margin: 'auto',
        marginTop: '10px',
        height: '18vh',
        width: '9vw',
    },
    btnclass: {
      position: 'absolute',
      marginLeft: '77vw',
      marginTop: '20vh',
    }
  },
  '@media (max-width: 800px)': {
    root: {
      flexGrow: 1,
    },
    box: {
      marginLeft: '6vw',
      marginTop: '4vh',  
      boxShadow: '0px 5px 7px 7px #888888',
      height: '35vh',
    },
    bacg: {
      position: 'absolute',
      height: '33vh',
      width: '70vw',
      filter: 'blur(10px)',
      clipPath: 'polygon(0 0, 100% 0%, 100% 43%, 0 64%)'
    },
    imag: {
        margin: 'auto',
        marginTop: '10px',
        height: '20vh',
        width: '37vw',
    },
    btnclass: {
      position: 'absolute',
      marginLeft: '77vw',
      marginTop: '20vh',
    }
  },
}

export default teamStyle;
